  Cars(4, 'Lada (ВАЗ) Vesta SW Cross, 2018', 'https://avatars.mds.yandex.net/get-autoru-vos/1574485/cd7d028b303a5433016a596034154d98/1200x900n', 'Standart', 1050000, 'Lada Vesta SW Cross 2018 - это универсальный автомобиль с ярким и динамичным дизайном. Он сочетает в себе просторный семейный универсал с элементами кроссовера, что делает его идеальным выбором для активного образа жизни. Vesta SW Cross оснащен мощным и экономичным 1,6-литровым двигателем, который обеспечивает плавное и комфортное движение на дороге. Кроме того, автомобиль оснащен передним приводом и 6-ступенчатой коробкой передач, что делает его отличным выбором для городской езды. Интерьер Vesta SW Cross выполнен в стильном и современном дизайне, с комфортабельными сиденьями и просторным багажником, что делает его отличным выбором для поездок на длительные расстояния или для перевозки больших грузов. В целом, Lada Vesta SW Cross 2018 - это отличный выбор для тех, кто ищет надежный и универсальный автомобиль с современным дизайном и хорошей проходимостью.', ['https://avatars.mds.yandex.net/get-autoru-vos/1567646/fc29e7abac520c779e9133786ce7af10/1200x900n','https://avatars.mds.yandex.net/get-autoru-vos/2048563/b8b3b685b3c899c3c742cb1e3bd19d46/1200x900n','https://avatars.mds.yandex.net/get-autoru-vos/1581437/8531b28b55d24ff9df536d163b9ca57b/1200x900n'], ['1774 см³','122 л.с.','Бензиновый','Универсал','Роботизированная'], 'https://youtu.be/_wbF5maBW2o'),
  Cars(5, 'Москвич 3, 2023', 'https://avatars.mds.yandex.net/get-autoru-vos/11608341/4acca36ac8a8b872def155ef09985ace/1200x900n', 'Comfort', 2478000, 'Современный городской кроссовер Москвич 3 начинает новую главу в истории легендарного бренда. Яркий дизайн и современные технологии открывают новые возможности для жизни в ритме большого города. Привлекательный дизайн кроссовера Москвич 3 отличают геометричные линии кузова, современная светодиодная оптика с узнаваемыми рисунками дневных ходовых и габаритных огней, легкосплавные колесные диски диаметром 17 дюймов. Москвич 3 оснащен современными технологиями и мультимедийными решениями: многофункциональный руль с электроусилителем и блоком управления круиз-контролем, цифровая приборная панель с дисплеем диагональю 10,25” и мультимедийной системой с сенсорным экраном такого же размера с возможностью подключения к смартфонам по протоколам Apple CarPlay и Android Auto, а также 6 динамиками и системой камер кругового обзора. Автомобиль оснащен электрическим стояночным тормозом с функцией автоудержания.', ['https://avatars.mds.yandex.net/get-autoru-vos/1924235/aabba7c823e245d817a767806a499316/1200x900n','https://avatars.mds.yandex.net/get-autoru-vos/11748220/4580ea538989b66073d6c18c5da43e6e/1200x900n ','https://avatars.mds.yandex.net/get-autoru-vos/11836446/174f9c8a4bc79f8ae26a9c3bfe166e40/1200x900n'], ['1499 см³','150 л.с.','Бензиновый','Внедорожник','Вариатор'], 'https://youtu.be/8zR3wF8UE6Y'),
  Cars(6, 'Lada (ВАЗ) Vesta, 2022', 'https://avatars.mds.yandex.net/get-autoru-vos/2167678/e3d9c6b5becd8710f3b7f20682427055/1200x900n', 'Comfort Winter EnjoY', 1550000, 'Lada Vesta 2022 - это компактный седан от российского производителя автомобилей ВАЗ. Модель Vesta представляет собой стильный и современный автомобиль с привлекательным дизайном и хорошей управляемостью. В 2022 году Lada Vesta обзавелась обновленным дизайном, улучшенной отделкой салона и более технологичными функциями. Автомобиль оснащен новейшими системами безопасности и комфорта, включая камеры заднего вида, системы помощи при парковке и технологию поддержки управления. Lada Vesta 2022 предлагает различные варианты двигателей, включая бензиновые и газобензиновые, а также варианты коробок передач, что позволяет выбрать оптимальную конфигурацию под свои потребности. Эта машина идеально подходит для городской езды и долгих поездок благодаря своей экономичности и надежности.', ['https://avatars.mds.yandex.net/get-autoru-vos/2167678/1da5b630add93a8c35f402cab518ddbd/1200x900n','https://avatars.mds.yandex.net/get-autoru-vos/6272922/62b9bb4817bafb67dfa2490576d8a22e/1200x900n','https://avatars.mds.yandex.net/get-autoru-vos/10932694/f235d18a372a3d398be1a5527fab7933/1200x900n'], ['1596 см³','113 л.с.','Бензиновый','Седан','Вариатор'], 'https://youtu.be/m_BFkPUhmF0'),
  Cars(7, 'Lada (ВАЗ) Niva Legend, 2023', 'https://avatars.mds.yandex.net/get-autoru-vos/1907895/17b991e216062fe25d5781304a31eeef/1200x900n', 'Classic 24', 929900, 'Lada Niva Legend 2023 - это современная версия легендарного внедорожника от российской автомобильной марки Lada. Этот автомобиль сочетает в себе непревзойденные возможности проходимости с комфортом и современными технологиями. Niva Legend оснащена мощным и надежным двигателем, который обеспечивает отличную проходимость в любых условиях. Внутри автомобиля просторный и удобный салон, оборудованный современными системами комфорта и безопасности. Дизайн Niva Legend сочетает в себе стиль и практичность, делая этот автомобиль привлекательным как для городских улиц, так и для бездорожья. Благодаря своей надежности и долговечности, Lada Niva Legend 2023 станет отличным выбором для тех, кто ищет надежный и универсальный внедорожник.', ['https://avatars.mds.yandex.net/get-autoru-vos/1907895/60a479680224c8b22aa447058c434182/1200x900n','https://avatars.mds.yandex.net/get-autoru-vos/1933512/df57b86e0a39e9143aef9941f9612c93/1200x900n','https://avatars.mds.yandex.net/get-autoru-vos/1887621/1c0f6b7fd2efbb558972ad4dfeee06e6/1200x900n'], ['1690 см³','83 л.с.','Бензиновый','Внедорожник','Механическая'], 'https://youtu.be/TqY_BDw9oSQ'),
  Cars(8, 'Lada (ВАЗ) Priora, 2010', 'https://avatars.mds.yandex.net/get-autoru-vos/11386586/14f50c64ae6dd32777397b8f0a625b14/1200x900n', 'Standart', 304000, 'Lada (ВАЗ) Priora - это компактный семейный автомобиль, производимый российским автопроизводителем Волжский автомобильный завод (ВАЗ). Модель Priora была представлена в 2007 году и с тех пор стала одной из самых популярных моделей бренда Lada. Автомобиль оснащается 1,6-литровым бензиновым двигателем мощностью 98 л.с. или 1,8-литровым двигателем мощностью 122 л.с. В зависимости от комплектации, Priora может быть с задним или передним приводом. Lada Priora отличается надежностью, простотой в обслуживании и доступной стоимостью. Внутри салона автомобиля комфортно могут разместиться 5 пассажиров, а багажное отделение вмещает до 430 литров груза. Благодаря умеренной жесткости подвески и отличной управляемости, Priora отлично справляется с городскими условиями и долгими поездками. Lada Priora - это простой, надежный и экономичный автомобиль, который пользуется популярностью среди тех, кто ищет недорогой и функциональный вариант для повседневного использования.', ['https://avatars.mds.yandex.net/get-autoru-vos/11789197/f656962acf967b22b677e3ddac6e1e0f/1200x900n','https://avatars.mds.yandex.net/get-autoru-vos/11387356/15ecf1033fca8bbb241171a20e73b2f3/1200x900n','https://avatars.mds.yandex.net/get-autoru-vos/11386586/10e37cf1ed98e9c9bb0ea3302c6abfc0/1200x900n'], ['1596 см³','98 л.с.','Бензиновый','Хэтчбек','Механическая'], 'https://youtu.be/isXeziBHQCo'),
